    "detailsArtesanias" : MessageLookupByLibrary.simpleMessage("Artesanias \n\n Las hábiles manos de las artesanas del cantón elaboran llamativas prendas bordadas y bisutería en piedras y mullos de colores llamativos, se utiliza colores vivos con los que se caracteriza la cultura cañarí. La elaboración de bisutería, son elaborados manualmente, pues esta labor es una forma de mantener una de las tradiciones de esta cultura milenaria."),
    "detailsCanari" : MessageLookupByLibrary.simpleMessage("Cultura Cañarí \n\n La palabra cañarí etimológicamente viene de Kan= culebra y de Ara = Guacamaya. Para algunos lingüistas significa descendiente de la culebra y de la guacamaya. La verdad es que estos animales fueron considerados sagrados.  Además de venerar a los cerros, a la luna y a las piedras jaspeadas, la cultura cañarí rendía culto a las múltiples lagunas que existen en la región."),
    "detailsCostumbres" : MessageLookupByLibrary.simpleMessage("Trillada de granos \nSe denomina trilla a la operación que se hace con los cereales (trigo, cebada, lenteja, etc.), después de la siega o cosecha, para separar el grano de la paja. Luego que las espigas del trigo y/o cebada están maduras y completamente secas, se procede al trillado y luego al ventilado. \n\nMinga \nLa palabra minga deriva de  minka  en quechua. Es una herencia de los ancestros.  Se conoce como minga a la colaboración desinteresada para la ejecución de obras en beneficio de las zonas indígenas y campesinas en muchas ocasiones reúne a las poblaciones para ejecutar las tradicionales mingas.\n\nPampa mesa\nEs una tradición ancestral,  los alimentos que se sirven en la “pampamesa” se colocan sobre un largo mantel blanco tendido sobre la tierra. La costumbre da cuenta que después de una jornada de trabajo o minga comunitaria la gente se reúne para compartir los alimentos preparados con productos de la zona (papas, mote, choclo, habas, fréjol, ocas, pollo, cuy, huevos, queso, ají con semillas de calabaza o zambo, máchica, entre otros. esta costumbre se mantiene para rendir homenaje a la “Pachamama” o Madre Tierra. \n\n Hilado\nEste proceso artesanal es largo es una costumbre netamente de las mujeres cañarís, el mismo que inicia desde que esquila la lana de las ovejas hasta formar las madejas, que preservan el particular olor de los animales. El escarmenado consiste en abrir el vellón, mechón por mechón, retirar las impurezas y ordenar las fibras. Al terminar elabora el guango envolviendo la fibra en una vara de madera. El arte empieza cuando tuerce la lana con las yemas de sus dedos y la convierte en un fino hilo, que lo enrolla en una rama de sigse que se obtiene en el campo."),
    "detailsGastronomia" : MessageLookupByLibrary.simpleMessage("Gastronomia \n\n Papas con cuy. - Plato típico de la localidad su elaboración se realiza a base de papas y cuy, es propio de las celebraciones o fiestas tradicionales. \n\n Ají.- El pueblo indígena cañarí, conoce diferentes formas de preparar el ají, entre las variedades de ají tenemos, tres principales, el ají de carne, el ají de quesillo (queso) y el ají de pepa de zambo que en la localidad es el más tradicional. \n\n Bebida típica- Chicha de Jora.- El proceso comienza con la germanización del maíz, se remoja, luego se lo coloca en una cama hecha de altamizo y chilca para que de sabor a la jora encima de esta cama se pone el penco partido para obtener humedad y que facilite el brote colocado el maíz se vuelve a tapar con hojas partidas de penco, luego la chilca y encima de esta el altamizo."),
    "detailsKilla" : MessageLookupByLibrary.simpleMessage("Killa Moda \n\n Es un evento netamente tambense en el cual las representantes de la belleza de cada cantón de la provincia del Cañar, dan a conocer mediante una pasarela, prendas elaboradas por artesanas de la provincia,  de manera particular las artesanas del cantón El Tambo, las cuales son prendas de vestir de la cultura indígena cañarí, este evento se lleva a cabo en la festividad que es en homenaje a la Madre Luna o el Killa Raymi que se da en el mes de septiembre de cada año."),
    "detailsKirk" : MessageLookupByLibrary.simpleMessage(" Distancia \n\n Quito - El Tambo\n 398 km\n6h33min vehiculo privado \n\n Cuenca – El Tambo\n 75.7km\n1h21min vehiculo privado \n\n Guayaquil – El Tambo\n 170.6km\n 3h00min vehiculo privado"),
    "detailsLeyenda" : MessageLookupByLibrary.simpleMessage("Leyenda de Espíndola \n\n Es el hijo de una serpiente macho en una mujer cañarí. Según los nativos cañarís, la historia dice que: un buen día una mujer se fue a lavar la ropa en la laguna, mientras cumplía con su trabajo, de pronto apareció una culebra y la llevo. Era una culebra inmensa. De ese rapto, surgió la unión entre la serpiente macho y la mujer y de esa unión nació un hijo, fue varón y decidieron llamarlo “Espíndola”. Él, Espíndola creció y habitaba en esas hoyas y a todos los viajeros que pasaban por esos lugares los asesinaba, hacía todo lo que venga a su antojo. La gente decía que Espíndola era un hombre, así de grande como los personajes de la mitología griega, tan grande que nadie podía con él. \n\n Leyenda de la Tunda Margarita \n\n Cuenta la leyenda que hace muchos años llego el tren al cantón el mismo que tenía como destino la cuidad de Cuenca  y en entre uno de sus vagones venía un circo con sus animales, entre esos animales se encontraba la osa Tunda Margarita, la misma que se escapó recorriendo las calles del pueblo y causando miedo entre sus habitantes, al llegar a saber sobre esta situación uno de los domadores del circo sale en busca de la osa, el mismo que luego de varias horas logro atraparla y recorrió las calles del cantón tocando un ajechador como anuncio de tranquilidad y alegría de que todos estaban a salvo pues la Tunda Margarita fue atrapada. Es así que este acontecimiento queda gravado en la mente de sus pobladores, la misma que se viene representando año tras año por personas oriundas desde el 20 de diciembre hasta el 6 de enero."),
    "detailsMedicina" : MessageLookupByLibrary.simpleMessage("Medicina ancestral \n\n La población rural e indígena pero también la mestiza durante siglos han sanado sus enfermedades mediante la medicina ancestral, la misma que está basada en el uso de plantas medicinales, productos provenientes de animales, complementados de rituales que son realizados por personas llamado YACHAY O SHAMAN, que poseen sus conocimientos los mismos que en su mayoría son heredados por sus antepasados."),
    "detailsRaymis" : MessageLookupByLibrary.simpleMessage("Raymis \n\n Killa Raymi \nInicio del calendario agrícola en este tiempo es la época de la preparación de la tierra y siembra, los cañarís hasta hoy en la actualidad festejan cada 21 de septiembre la fiesta a la madre luna. Cada una de estas actividades está acompañada de la ritualidad en honor a la madre tierra y la luna. \n\n Kapak Raymi\nLos cañarís celebran el nacimiento del sol como el inicio de un nuevo ciclo conocido como Kapak se celebra cada 21 de diciembre como una solemnidad a la iniciación de la madurez de los adolescentes que pueden convertirse en verdaderos amawtas, kurakas, yachak y mamakunas, así como también en honor a los grandes líderes y apuks. \n\nLalay Raymi \nEsta fiesta y ritualidad se lleva a cabo cada 21 de marzo de cada año es en honor a la floración, fecundación y reproducción de las cementeras y al Taita Carnaval, lo que se quiere trasmitir con esta celebración es dar ánimo y alegría pues obtendremos nuevos frutos producidos y que dará la manutención dentro del hogar y la comunidad. \n\nInti Raymi \nEs un ritual sagrado dedicado al sol, siendo su gran día el 21 de junio, es el solsticio de verano, tiempo de agradecimiento a la Pachamama por todas las cosechas y frutos recibidos, conjuntamente preparándose con danza y ofrendada pues es el último ciclo productivo anual específicamente de maíz que es y sigue siendo el sustento principal del pueblo cañarí."),
    "detailsvestimenta" : MessageLookupByLibrary.simpleMessage("Vestimenta Típica \n\n El indígena varón utiliza un sombrero hecho de lana de borrego de color blanco de forma semiesférica faldeada por una pequeña visera que está adornada con una elegante trenza. La mujer viste polleras (faldas) de variados colores y principalmente negras, lleva consigo blusa blanca bordada, y reata de preferencia de color negro, con un tupo (pasador) que le da soporte a la pieza, adornada de collares de perlas rojas, celestes, aretes de plata con motivos propios de la cosmovisión cañarí y su pelo a manera de trenza."),
